import React from 'react';
import ButtonsComponent from './buttonComponents';  // Verifică să fie calea corectă

function Introducere() {
    return (
        <div className="flex w-full">
            {/* Panoul cu butoane, ocupând o parte fixă a lățimii ecranului și rămânând în stânga */}
            <div className="w-1/4 h-screen sticky top-0">
                <ButtonsComponent currentButton={1} 
                
                />
            </div>

            {/* Conținutul principal al paginii de introducere, ocupând restul spațiului */}
            <div className="w-3/4 p-4">
                <h1>Bine ai venit la Introducere!</h1>
                <p>Detalii relevante despre introducere...</p>
            </div>
        </div>
    );
}

